import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";

import { Films } from "./components/Films";

export function App(props) {
  render(
    <Router>
      <div>
        <Route exact path="/">
          <Home />
        </Route>
        <Route path="/films">
          <Films />
        </Route>
      </div>
    </Router>
  );
}
